INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1.4, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, "春咲 ひより", "お！\nあそこに困ってそうな人発見！", 2, 0, 1, 0, 1001, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "みんなみたいに\nわたしも強くならなきゃ", 1.4, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, "草野 優衣", "大切な人を\n守れるようになりたい…って", 2, 0, 1, 0, 1002, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "フェンシングを始めてみては？", 1.4, 0, "少しは磨かれると思いますよ。", 0, "士条 怜", "キミに必要な集中力と感性が", 2, 0, 1, 0, 1003, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "ねぇ、にいちゃん！", 1.5, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 0, "穂高 みそぎ", "今日はなにして遊ぶ？", 2, 0, 1, 0, 1004, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "風宮あかりです", 1.4, 0, "私といっしょに…\nいかない？", 0, "風宮 あかり", "ねぇ…", 2, 0, 1, 0, 1006, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "出雲宮子なのー", 1.5, 0, "食べ物の恨みは怖いのー", 0, "出雲 宮子", "プリンたべたいのー", 2, 0, 1, 0, 1007, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "ボクは虹村雪。", 1.4, 0, "いいよ。\n見られることは運命さ…", 0, "虹村 雪", "キミもボクの美貌に\n吸い寄せられたんだね。", 2, 0, 1, 0, 1008, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "フッ…聞いて後悔するがいい！", 1.4, 0, "人呼んで「疾風の冥姫」!!", 0, "柊杏奈", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, 0, 1, 0, 1009, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "マホマホ王国のプリンセス、\nまほ姫どす", 1.5, 0, "ほんまおおきにやわ～♪", 0, "姫宮 真歩", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, 0, 1, 0, 1010, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "衣之咲璃乃です！", 1.4, 0, "ここで会ったが\n100年目～！", 0, "衣之咲 璃乃", "生き別れたお兄ちゃんを探して\n三千世界！", 2, 0, 1, 0, 1011, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1.4, 0, "…って、お願い！\n誰にも言わないでおいて～！", 0, "柏崎 初音", "ち、超能力って…\n何のことかな～？", 2, 0, 1, 0, 1012, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "ちょす！\n美波鈴奈だよ～♪", 1.4, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, "美波 鈴奈", "一応カリスマ読モJKやってまっす！", 2, 0, 1, 0, 1016, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "はいたーい。\n喜屋武香織さー。", 1.4, 0, "でも、沖縄もとってもいいとこさー", 0, "喜屋武 香織", "東京は遊園地みたいなところさー", 2, 0, 1, 0, 1017, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "支倉伊緒です。", 1.4, 0, "イオちゃんって呼んでね。", 0, "支倉 伊緒", "先生って呼ばれるのは\nくすぐったいから", 2, 0, 1, 0, 1018, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1.5, 0, "ミミをおいてかないでぇ～", 0, "茜 ミミ", "あ！/\お兄ちゃ～ん\nまってよ～", 2, 0, 1, 0, 1020, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "あ…あの…えっと…\n栗…林…くるみ…です……", 1.5, 0, "ふぇぇぇぇぇん……", 0, "栗林 くるみ", "あの……\nふぇ……", 2, 0, 1, 0, 1021, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "風宮よりです。\nあああああ！", 1.4, 0, "なんてありがとうございます！", 0, "風宮 より", "こんな私に貴重な時間を\n割いていただき、", 2, 0, 1, 0, 1022, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1.5, 0, "私こっち行きたいー\nね、早く早くー", 0, "北条 綾音", "おにいちゃんどこいくの？\nえ？", 2, 0, 1, 0, 1023, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "わっ…わっ…私、\n天野すずめといいます！", 1.4, 0, "これて何か違う…\nあああすみません！", 0, "天野 すずめ", "ふ、不束者ですが\nどうぞ末永く…って、", 2, 0, 1, 0, 1025, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "……クスクス…私は\n…倉石恵理子……", 1.4, 0, "離しませんわ………\n絶対に…!!", 0, "倉石 恵理子", "あなたは…運命の……\n伴侶……", 2, 0, 1, 0, 1027, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1.4, 0, "…そうでしょ？？", 0, "佐々木 咲恋", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, 0, 1, 0, 1028, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "桜井望だよ！\nよろしくねっ", 1.4, 0, "あはは、\n私もまだまだだなぁ～", 0, "桜井 望", "ぇっと…\nキミ、私のこと知らないの?!", 2, 0, 1, 0, 1029, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "デケデケデンっ！", 1.4, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 0, "ニノン・ジュベール", "初めまして、\n私はニノン・ジュベール申すデス！", 2, 0, 1, 0, 1030, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "上喜しのぶです。\n手元のドクロが父です。", 1.4, 0, "おかしいですね……", 0, "上喜 しのぶ", "でもって私の隣にいるのが……\nえ、見えない？", 2, 0, 1, 0, 1031, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "目指すはビッグな\nお笑い芸人だっぺ！", 1.5, 0, "そう、\nオラのボケに突っ込める相方が…！", 0, "野戸まひる", "けんども\nそれには足りないモンが…", 2, 0, 1, 0, 1033, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1.4, 0, "ちょ\nちょっと一杯飲んできます…！", 0, "綾瀬 ゆかり", "ちょっと緊張しちゃって…", 2, 0, 1, 0, 1034, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "氷川鏡華…です", 1.5, 0, "これ以上お話しすることは…\nないです！", 0, "氷川 鏡華", "知らない人とは話しちゃいけないので", 2, 0, 1, 0, 1036, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "柏崎…栞です。", 1.4, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, "柏崎 栞", "……あ、アラーム。", 2, 0, 1, 0, 1038, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "ふ、双葉碧です。", 1.4, 0, "野に咲く花が、\n唯一の話相手です。", 0, "双葉 碧", "私、一人も友達がいなくて……", 2, 0, 1, 0, 1040, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "三角千歌です。", 1.4, 0, "そう思っています。", 0, "三角 千歌", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, 0, 1, 0, 1042, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "安芸真琴だ。", 1.4, 0, "う、疑ってすまなかったな…", 0, "安芸 真琴", "あぁ？\nお前のそいつの仲間か？", 2, 0, 1, 0, 1043, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "わらわこそは夜を総べる者！", 1.4, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, "イリヤ・オーンスタイン", "生けとし生ける全ての者よ！", 2, 0, 1, 0, 1044, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "そこで騎士は妖精を乱暴に……", 1.4, 0, "ｌク、クウカに何かご用ですか!?", 0, "遠見 空花", "ぐふふふふ……はっ！", 2, 0, 1, 0, 1045, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1.4, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 0, "宮坂たまき", "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, 0, 1, 0, 1046, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "大神美冬よ！", 1.4, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, "大神 美冬", "それでは早速クエストに…", 2, 0, 1, 0, 1048, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "星野静流だよ！", 1.4, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, "星野静流", "クエストもバトルも\n掃除も洗濯も", 2, 0, 1, 0, 1049, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "アタシは玉泉美咲。", 1.5, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, "玉泉美咲", "見ての通りの\nセクシー美少女で", 2, 0, 1, 0, 1050, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "？？？", 1.4, 0, "？？？？", 0, "リマ", "？？？？", 2, 0, 1, 0, 1052, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "モニカ・ヴァイスヴィントだ。", 1.5, 0, "そ、そこまでいうなら\nもらってやる", 0, "モニカ・ヴァイスヴィント", "菓子でつろうなどと\n稚拙な策を……", 2, 0, 1, 0, 1053, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "モニカ・ヴァイスヴィントだ。", 1.5, 0, "そ、そこまでいうなら\nもらってやる", 0, "ペコリーヌ", "菓子でつろうなどと\n稚拙な策を……", 2, 0, 1, 0, 1058, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "モニカ・ヴァイスヴィントだ。", 1.5, 0, "そ、そこまでいうなら\nもらってやる", 0, "コッコロ", "菓子でつろうなどと\n稚拙な策を……", 2, 0, 1, 0, 1059, 1, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1, "モニカ・ヴァイスヴィントだ。", 1.5, 0, "そ、そこまでいうなら\nもらってやる", 0, "キャル", "菓子でつろうなどと\n稚拙な策を……", 2, 0, 1, 0, 1060, 1, 0);
